    }

  render() {
    const columns = ["Tasks", "Reach", "Impact", "Confidence", "Effort", "Score"];

    const data = this.state.data;

    const options = {
      filterType: "dropdown",
      responsive: "stacked",
      rowsPerPageOptions: [10, 20, 100]
    };

    return (
    <span>
    <HeaderBar />
      <MUIDataTable
        title={"Product Board / Scoring Table"}
        data={data}
        columns={columns}
        options={options}
      />
    <FormDialog />
      </span>
    );
  }
}


// Dialog
export default class FormDialog extends React.Component {
  state = {
    open: false,
    reach: 0,
    impact: 0,        
    confidence: 0,
    effort: 0,
    score: 0
  };

  handleClickOpen = () => {
    this.setState({ open: true });
  };

  handleClose = () => {
    this.setState({ open: false });
  };

  handleChange = name => event => {
    this.setState({
      [name]: event.target.value,
    });
  };

  render() {
    return (
      <div>
        <Button variant="outlined" color="primary" onClick={this.handleClickOpen}>
          Add task
        </Button>
        <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="form-dialog-title"
        >
          <DialogTitle id="form-dialog-title">Add Task</DialogTitle>
          <DialogContent>
            <DialogContentText>
              To add a new task to the list, add numbers for each section. 
            </DialogContentText>
            <TextField
          id="reach-number"
          label="Reach"
          value={this.state.reach}
          onChange={this.handleChange('reach')}
          type="number"
          InputLabelProps={{
            shrink: true,
          }}
          margin="normal"
        />
            <TextField
          id="reach-number"
          label="Impact"
          value={this.state.reach}
          onChange={this.handleChange('impact')}
          type="number"
          InputLabelProps={{
            shrink: true,
          }}
          margin="normal"
        />
            <TextField
          id="reach-number"
          label="Confidence"
          value={this.state.reach}
          onChange={this.handleChange('confidence')}
          type="number"
          InputLabelProps={{
            shrink: true,
          }}
          margin="normal"
        />
            <TextField
          id="reach-number"
          label="Effort"
          value={this.state.reach}
          onChange={this.handleChange('effort')}
          type="number"
          InputLabelProps={{
            shrink: true,
          }}
          margin="normal"
        />
          </DialogContent>
          <DialogActions>
            <Button onClick={this.handleClose} color="cancel">
              Cancel
            </Button>
            <Button onClick={this.handleClose} color="primary">
              Add new task
            </Button>
          </DialogActions>
        </Dialog>
      </div>
    );
  }
}

ReactDOM.render(<App />, document.getElementById("root"));
